import { CampaingName, HeaderContainer, CampaingId } from './styles'

interface Props {
  idCampaing: number
  name: string
}

const HeaderCampaing = ({ idCampaing, name }: Props) => {
  return(
    <HeaderContainer>
      <CampaingName>{name}</CampaingName>
      <CampaingId>{idCampaing}</CampaingId>
    </HeaderContainer>
  )
}

export default HeaderCampaing
